import React, { useEffect, useState } from 'react';

export default function Players() {

    const [state, setState] = useState(null)

    const getPlayers = () =>
        fetch("https://localhost:5001/Players")
            .then((res) => res.json())

    useEffect(() => {
        getPlayers().then((data) => setState(data))
    })        

    return (
        <>
            <h1>Players:</h1>
            <div>
                {state?.map((item) =>
                <ul>
                    <li>{item.name}</li>
                </ul>
                )}
            </div>
        </>
    );
}
